import styles from "../styles/About.module.css";
import { Box } from "@mui/material";
const About = () => {
  return (
    <div className={styles.all}>
      <Box></Box>
      <div className={styles.about_box}>
        <p>Hi, I'm Sana Merchant</p>
      </div>
    </div>
  );
};

export { About };
